Text of telegraph relating an order for potatoes by Rathbun. Nov 13th 1874.

Nealon's diary begins on p.28, November 11th: &quot;Left Home for Shanty about two O'Clock. Walked to Station and went on Cars to Belleville took the Cab to O'Briens. Staid there over night. Slept with Mathew Butler, Toby Butler, W. R. Aylsworth &amp; J. W. Stoakes there attending Court trial between Rathbuns &amp; Arch Culbertston. Clear day.&quot;

12th: &quot;Left O'Briens in the morning went to Court House with Butler did not stop long went from there to see Ellen Murphy. Returning called at Regestry Office found Deed Recorded in June 1873. Left town at 1/2 past two on Madoc Stage in company with Patrick Feeney. Slept at Moons over night. Paid Jas Barrett $35.00.&quot;

Part of Denis Nealon's diary and account book.
